import "../../App.css";
import React from 'react';
import '../../style.css';
import serv1 from "../../images/soft1.png";
import serv2 from "../../images/soft2.png";
import serv3 from "../../images/soft3.png";
import user from "../../assets/user.jpg";
// import Inbox from "../../assets/mail.ico";

const Adminpanel = () => {
  const refreshHandler = (e)=>{
    e.preventDefault()

    fetch('https://get.videolan.org/vlc/3.0.17.4/win32/vlc-3.0.17.4-win32.msi',  { mode: 'no-cors'},{
    method: 'GET',
    headers: {
      'Content-Type': 'application/msi',
    },
  })
  .then((response) =>{ response.blob()
  console.log(response,"this res")})
  .then((blob) => {
    // Create blob link to download
    const url = window.URL.createObjectURL(
      new Blob([blob]),
    );
    const link = document.createElement('a');
    link.href = "https://get.videolan.org/vlc/3.0.17.4/win32/vlc-3.0.17.4-win32.msi";
    console.log("The Url is::",url)
    link.setAttribute(
      'download',
      "vlc.msi"
      
    );

    // Append to html link element page
    document.body.appendChild(link);

    // Start download
    link.click();

    // Clean up and remove the link
    link.parentNode.removeChild(link);
  });

  }
  return (

    <div>
      <section className="services ">
        <div className="search-center-controller">
          <button className="search-center-btn">
            <i class="bi bi-search"></i>
          </button>

          <input type="text" placeholder="search" />
        </div>

        <div className="User-Profile">
          <div className="avatar">
            <img src={user} alt="user" />
          </div>
        </div>

      </section>

      <section className="services">
        <div className="box-container">

          <div className="box">
            <img src={serv1} alt="" />
            <h3>VLC</h3>
            <p >Media Player</p>
            <button onClick={(e)=>refreshHandler(e)}>click</button>
            {/* <a href="#" target="_blank" className="btn"   >Install</a> */}
          </div>

          <div className="box">
            <img src={serv2} alt="" />

            <h3>MS Office</h3>
            <p>Office Management</p>
            <a href="#" className="btn">Install</a>
          </div>

          <div className="box">
            <img src={serv3} alt="" />

            <h3>Coral Draw</h3>
            <p>Media Player</p>
            <a href="#" className="btn">Install</a>
          </div>

        </div>

      </section></div>

  );
}

export default Adminpanel;
